import BoardFactory from "./Board";

const ChessFactory = () => {

    return Object.create({
        board: BoardFactory(),
        turn: 'white',
        getBoard() {
            return this.board.board;
        },
        printBoard() {
            console.log(this.board.boardToString());
        },
        printMoves() {
            console.log(this.board.generateMovesList());
        }
    })

}

export default ChessFactory;
